// src/index.js

import React from "react";
import ReactDOM from "react-dom/client";
import './index.css'; // Tailwind directives honi chahiye yahan

import App from './App';

// 'root' id waale element me render karo (public/index.html mein hota hai)
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
